import React from 'react';
import { useSelector, useDispatch } from 'react-redux';
import PropTypes from 'prop-types';
import { Menu, Breadcrumb, Layout } from 'antd';
import {
  AppstoreOutlined,
  HomeOutlined,
  UserOutlined,
  ContainerOutlined,
  BulbOutlined,
  LogoutOutlined,
} from '@ant-design/icons';
import { LOG_OUT_REQUEST } from '../reducers/user';

const { SubMenu } = Menu;
const { Header, Content, Sider } = Layout;

const AppLayout = ({ children }) => {
  const { info } = useSelector((state) => state.user);
  const dispatch = useDispatch();

  const handleClick = (e) => {
    console.log(e.key);
    switch (e.key) {
      case 'home':
        break;
      case 'user':
        break;
      case 'problem':
        break;
      case 'concept':
        break;
      case 'freedom':
        break;
      case 'information':
        break;
      case 'club':
        break;
      case 'inquiry':
        break;
      case 'logout':
        dispatch({
          type: LOG_OUT_REQUEST,
        });
        break;
      default:
        break;
    }
  };

  return (
    <>
      <Layout>
        <Header className="header">
          <div className="logo" />
          <Menu theme="dark" mode="horizontal" defaultSelectedKeys={['2']}>
            <Menu.Item key="1">nav 1</Menu.Item>
            <Menu.Item key="2">nav 2</Menu.Item>
            <Menu.Item key="3">nav 3</Menu.Item>
          </Menu>
        </Header>
        <Layout>
          <Sider width={200} className="site-layout-background">
            <Menu
              onClick={handleClick}
              defaultSelectedKeys={['1']}
              defaultOpenKeys={['']}
              mode="inline"
              theme="dark"
              forceSubMenuRender="true"
            >
              <div style={{ height: '130px', textAlign: 'center' }}>
                <img
                  src="https://user-images.githubusercontent.com/39295881/86248913-7f8de080-bbe9-11ea-801a-73f4f426ed0d.png"
                  alt="img"
                  style={{ width: '150px', marginTop: '10px' }}
                />
              </div>
              <Menu.Item key="home" icon={<HomeOutlined />}>
                Home
              </Menu.Item>
              <Menu.Item key="user" icon={<UserOutlined />}>
                {info.nickname}님
              </Menu.Item>
              <SubMenu key="sub1" icon={<BulbOutlined />} title="공부하냥">
                <Menu.Item key="problem">문제풀이</Menu.Item>
                <Menu.Item key="concept">개념이해</Menu.Item>
              </SubMenu>
              <SubMenu key="sub2" icon={<AppstoreOutlined />} title="게시판">
                <Menu.Item key="freedom">자유게시판</Menu.Item>
                <Menu.Item key="information">정보게시판</Menu.Item>
                <Menu.Item key="club">동아리·학회</Menu.Item>
              </SubMenu>
              <Menu.Item key="inquiry" icon={<ContainerOutlined />}>
                문의하기
              </Menu.Item>
              <Menu.Item key="logout" icon={<LogoutOutlined />}>
                로그아웃
              </Menu.Item>
              <div style={{ height: '200px' }} />
            </Menu>
            <Layout style={{ padding: '0 24px 24px' }}>
              <Breadcrumb style={{ margin: '16px 0' }}>
                <Breadcrumb.Item>Home</Breadcrumb.Item>
                <Breadcrumb.Item>List</Breadcrumb.Item>
                <Breadcrumb.Item>App</Breadcrumb.Item>
              </Breadcrumb>
              <Content
                className="site-layout-background"
                style={{
                  padding: 24,
                  margin: 0,
                  minHeight: 280,
                }}
              >
                {children}1231231
              </Content>
            </Layout>
          </Sider>
        </Layout>
      </Layout>
    </>
  );
};

AppLayout.propTypes = {
  children: PropTypes.node.isRequired,
};

export default AppLayout;
